type NavProps = {
  children: React.ReactNode;
  navigatePage: (type: "next" | "previous") => void;
};
const Navigation: React.FC<NavProps> = ({ children, navigatePage }) => {
  return (
    <li className="pagination__item nav" onClick={() => navigatePage("next")}>
      {children}
    </li>
  );
};

export default Navigation;
